import React from 'react'
import img1 from '../images/achar.jpeg'
import img2 from '../images/achar.jpeg'
import img3 from '../images/achar.jpeg'


const data={
    cardData:[
        {
            id:1,
            img:img1,
            tittle:'blog1',
            desc:'desc1'
        },
        {
            id:2,
            img:img2,
            tittle:'blog2',
            desc:'desc2'
        },
        {
            id:3,
            img:img3,
            tittle:'blog3',
            desc:'desc3'
        }
    ]
}

export default data
